import React from 'react';
import {Table} from "react-bootstrap";

export default class QBData extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            items: []
        };
    }
    componentDidMount() {
        fetch('http://localhost:8080/getInventory', {method: 'GET'})
            .then(res => res.json())
            .then(items=>this.setState({items}))
            .catch(function(error) {
                console.log('There has been a problem with your fetch operation: ' + error.message);
                throw error;
            })
    }
    render() {
        const {items} = this.state;
        let itemArray = new Array(items.length);
        let i = 0;
        for(var key in items){
        itemArray[i] = items[key];
        i = i + 1;
        }

        const names = [];
        const descNames =[];
        const price = [];
        const quantity = [];


        function y() {
            for(var x in itemArray[0]){
                var temp = itemArray[0][x];
                names[x] = temp;
            }
        }

        function f() {
            for(var x in itemArray[2]){
                var temp = itemArray[2][x];
                descNames[x] = temp;
            }
        }

        function z() {
            for(var x in itemArray[3]){
                var temp = itemArray[3][x];
                price[x] = temp;
            }
        }

        function a() {
            for(var x in itemArray[3]){
                var temp = itemArray[3][x];
                quantity[x] = temp;
            }
        }

        f();
        y();
        z();
        a();

        return (
            <>

                <div style={{marginTop: '20px', marginLeft: '265px', width: '1100px', height: '400px'}}>
                    <Table striped bordered hover variant={true}>
                        <thead>
                        <tr>
                            <th>Fully Qualified Name</th>
                            <th>Item</th>
                            <th>Description</th>
                            <th>Price</th>
                            <th>Quantity</th>
                        </tr>
                        </thead>
                        <tbody>
                        <tr>
                            <td>{names[0]}</td>
                            <td>null</td>
                            <td>{descNames[0]}</td>
                            <td>{price[0]}</td>
                            <td>{quantity[0]}</td>
                        </tr>
                        </tbody>
                    </Table>
                </div>

            </>


        );

    }
}
